import * as o from "react";
import i from "../lib/IconBase.es.js";
import c from "../defs/Radioactive.es.js";
const a = o.forwardRef((e, t) => /* @__PURE__ */ o.createElement(i, { ref: t, ...e, weights: c }));
a.displayName = "RadioactiveIcon";
const s = a;
export {
  s as Radioactive,
  a as RadioactiveIcon
};
